import React, {Component, useState} from 'react';
import {Bar} from 'react-chartjs-2';


interface  dataset{
	label: string,
	data: number[],
	backgroundColor: string[],
	borderColor: string[],
	borderWidth: number
}

interface properties {
	data: {
		labels: string[],
		datasets: dataset[]

	}
}

export default class BubbleChart extends Component<properties>{
	constructor(props:properties) {
		super(props);
	}


	render(){
		return(
			<div>{this.props.data.labels}</div>
		);

	}


}
